import './styles.css';
import '../../App.css';

function SecondInfoComponent() {
    return (
        <div className="SecondInfoComponent">
            <p className="Title">
                Education and Achievements
            </p>
            <p className="Subtitle">
                My passions are: ideas, literature, technology and people.
                My dream is to help create new and inspiring innovations.
            </p>
        </div>
    );
}

export default SecondInfoComponent;
